import React, { useState } from "react";

function Counter() {
  const [count] = useState(0);
  return (
    <React.Fragment>
      <h1>Hello</h1>
      <span>{formatCount()}</span>
      <button>TEST</button>
    </React.Fragment>
  );

  function formatCount() {
    return count === 0 ? "zero" : count;
  }
}

export default Counter;
